import React from 'react'

export default function StopBtn({session, disable}) {


  return (
    <button
      type="button"
      className="btn btn-secondary"
      data-testid="stop"
      title="Stop the session"
      disabled={!session ? disable.stopBtn : !disable.stopBtn}
    >
      <span className="oi oi-media-stop" />
    </button>
  )
}
